import React, { useState, useEffect } from "react"
import axios from "axios"

function HomePage() {
  const [cars, setCars] = useState([])
  const [selectedCar, setSelectedCar] = useState(null)

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/cars")
      .then((response) => {
        setCars(response.data)
      })
      .catch((error) => {
        console.error("Error fetching car data:", error)
      })
  }, [])

  const handleCarSelection = (car) => {
    setSelectedCar(car)
  }

  return (
    <div>
      <h1>Available Cars</h1>
      <ul>
        {cars.map((car) => (
          <li key={car.id}>
            <h2>{car.name}</h2>
            <p>Available Time Slots:</p>
            <ul>
              {car.timeSlots.map((timeSlot) => (
                <li key={timeSlot.id}>
                  <a href={`/booking/${car._id}`}>Book</a>
                </li>
              ))}
            </ul>
            <button onClick={() => handleCarSelection(car)}>Select Car</button>
          </li>
        ))}
      </ul>
      {selectedCar && (
        <div>
          <h2>Selected Car: {selectedCar.name}</h2>
          <p>Available Time Slots:</p>
          <ul>
            {selectedCar.timeSlots.map((timeSlot) => (
              <li key={timeSlot.id}>
                <a href={`/booking/${selectedCar._id}`}>Book</a>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  )
}

export default HomePage
